import React, { useState, useEffect } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCheck } from '@fortawesome/free-solid-svg-icons'
import axios from '../../store/axios-instance';

import './Services.scss';

const Services = () => {

    const [ servicesInfo, setServicesInfo ] = useState({data: []});

    useEffect (async () => {

        document.title = "Container Logistik – ein Partner und alle Leistungen | Kaefer Logistik";

        axios.get('/services.json')
            .then(res => {
                console.log('=== Here is services =: ', res.data.services);

                setServicesInfo({servicesInfo : res.data.services});
            })
            .catch(err => {
                console.log('ERROR');
               // setServicesInfo([]);
            });
    });
   console.log('==servicesInfo==',servicesInfo);
    return (
   <div>test</div>
    );
};

export default Services;
